.4830770442704,555.1948686550302"></path><path class="arc" d="M712.7377087595675,400.5565440578983L566.1834954697349,405.28925050590357L419.6193322514339,409.7076845803325L273.0455392349438,413.80902032377526L229.01996604945236,414.97816661319166"></path><path class="arc" d="M712.7377087595675,400.5565440578983L852.1911003087786,355.16714475331145L896.8852618180263,340.5201524347823"></path><path class="arc" d="M712.7377087595675,400.5565440578983L846.4098025062583,340.2080370904949L979.879248731484,279.41053035602204L1081.2247767354652,232.8784630325619"></path><path class="arc" d="M712.7377087595675,400.5565440578983L800.3940278707394,425.49463666518204"></path><path class="arc" d="M712.7377087595675,400.5565440578983L832.6938930921382,484.8452822560916L952.6134843987638,569.1861040222961L1030.7898091708944,624.2109759253472"></path><path class="arc" d="M712.7377087595675,400.5565440578983L719.9654867911877,254.05751490405336L722.9705067266493,189.63369454085566"></path><path class="arc" d="M712.7377087595675,400.5565440578983L800.4886489250617,283.0043448551132L823.1320782007124,252.50591812998914"></path><path class="arc" d="M712.7377087595675,400.5565440578983L858.7997237382355,387.6064007258203L1004.8313383693151,374.31259224861026L1017.8702843581007,373.10857774076374"></path><path class="arc" d="M712.7377087595675,400.5565440578983L786.828585557671,273.94799509433597L801.0376105028663,249.5283705777651"></path><path class="arc" d="M712.7377087595675,400.5565440578983L729.6988108463692,376.2527422347768"></path><path class="arc" d="M712.7377087595675,400.5565440578983L576.0831289569192,347.4546483947184L439.4589774348945,294.2744905235347L382.3460090159613,272.0167368544649"></path></g><g><path class="cell" d="M36.05944610565573,-273.1749146359226L22.22960880833387,-237.33724606471515L116.59077450850405,-255.61835586146321L221.30936373878777,-318.62920433524437L300.2523339114164,-376.0549591079488L184.21104620522854,-381.59176563855084Z"></path><path class="arc" d="M138.87418286659658,-301.920310443458L94.55814865629156,-362.4781602390118"></path><path class="arc" d="M138.87418286659658,-301.920310443458L180.0297900745062,-245.34385123782795"></path></g><g><path class="cell" d="M240.23170514708,97.12130746541871L250.74073260599835,127.48527305267757L260.1992372165678,132.06715351023558L289.6257671715354,84.84086074890223L284.5739010660676,63.41237450070312L283.9591991881755,63.569797135167306Z"></path><path class="arc" d="M264.38434853577337,101.59540244519746L347.8095449718599,222.55035727812555L382.3460090159613,272.0167368544649"></path></g><g><path class="cell" d="M252.76440608846463,547.1155936319657L135.9540916530393,1063.9798674634253L332.5076937761654,483.8146305843843L320.3948281928135,419.43024561190407L309.1017316869,418.9577869118146L303.86681059440224,423.8405194305918Z"></path><path class="arc" d="M299.5032610829377,461.19157060692055L403.76989902136273,357.6268763097809L440.8760071659825,321.18627559777275"></path><path class="arc" d="M299.5032610829377,461.19157060692055L280.5247108271521,453.3242092738165"></path><path class="arc" d="M299.5032610829377,461.19157060692055L303.06441820558626,376.06986356422794"></path><path class="arc" d="M299.5032610829377,461.19157060692055L229.01996604945236,414.97816661319166"></path><path class="arc" d="M299.5032610829377,461.19157060692055L355.03433094644333,450.74431099197074"></path><path class="arc" d="M299.5032610829377,461.19157060692055L358.31850276911644,325.88902881542776L382.3460090159613,272.0167368544649"></path></g></g></svg><h2>
      <span>Pueblo Memorial</span>, 2008<br>
      great arcs and symbol map
    </h2>
    <div style="position:absolute;bottom:0;font-size:18px;">
      <input type="checkbox" id="voronoi"> <label for="voronoi">show Voronoi</label>
    </div>
    <script type="text/javascript" src="./airports_files/d3.js"></script>
    <script type="text/javascript" src="./airports_files/d3.csv.js"></script>
    <script type="text/javascript" src="./airports_files/d3.geo.js"></script>
    <script type="text/javascript" src="./airports_files/d3.geom.js"></script>
    <script type="text/javascript">

var w = 1280,
    h = 800;

var projection = d3.geo.azimuthal()
    .mode("equidistant")
    .origin([-98, 38])
    .scale(1400)
    .translate([640, 360]);

var path = d3.geo.path()
    .projection(projection);

var svg = d3.select("body").insert("svg:svg", "h2")
    .attr("width", w)
    .attr("height", h);

var states = svg.append("svg:g")
    .attr("id", "states");

var circles = svg.append("svg:g")
    .attr("id", "circles");

var cells = svg.append("svg:g")
    .attr("id", "cells");

d3.select("input[type=checkbox]").on("change", function() {
  cells.classed("voronoi", this.checked);
});

d3.json("us-states.json", function(collection) {
  states.selectAll("path")
      .data(collection.features)
    .enter().append("svg:path")
      .attr("d", path);
});

d3.csv("flights-airport.csv", function(flights) {
  var linksByOrigin = {},
      countByAirport = {},
      locationByAirport = {},
      positions = [];

  var arc = d3.geo.greatArc().precision(3)
      .source(function(d) { return locationByAirport[d.source]; })
      .target(function(d) { return locationByAirport[d.target]; });

  flights.forEach(function(flight) {
    var origin = flight.origin,
        destination = flight.destination,
        links = linksByOrigin[origin] || (linksByOrigin[origin] = []);
    links.push({source: origin, target: destination});
    countByAirport[origin] = (countByAirport[origin] || 0) + 1;
    countByAirport[destination] = (countByAirport[destination] || 0) + 1;
  });
//console.log('countByAirport'+JSON.stringify(countByAirport))//???"???"
//console.log('linksByOrigin'+JSON.stringify(linksByOrigin)) //??,???+????

  d3.csv("airports.csv", function(airports) {

    // Only consider airports with at least one flight.
    airports = airports.filter(function(airport) {
      if (countByAirport[airport.iata]) {
        var location = [+airport.longitude, +airport.latitude];
        locationByAirport[airport.iata] = location;
        positions.push(projection(location));
        return true;
      }
    });
	console.log('locationByAirport'+JSON.stringify(locationByAirport))//?????(????)
//console.log(positions)  ?????(????)
    // Compute the Voronoi diagram of airports' projected positions.
    var polygons = d3.geom.voronoi(positions);

    var g = cells.selectAll("g")
        .data(airports)
      .enter().append("svg:g");
//????????
    g.append("svg:path")
        .attr("class", "cell")
        .attr("d", function(d, i) { 
	//	console.log(polygons[i])
		return "M" + polygons[i].join("L") + "Z"; })
        .on("mouseover", function(d, i) { d3.select("h2 span").text(d.name); });
//??????????????
    g.selectAll("path.arc")
        .data(function(d) { return linksByOrigin[d.iata] || []; })
      .enter().append("svg:path")
        .attr("class", "arc")
        .attr("d", function(d) { 
		console.log(path(arc(d)))
		return path(arc(d)); });
//
    circles.selectAll("circle")
        .data(airports)
      .enter().append("svg:circle")
        .attr("cx", function(d, i) { return positions[i][0]; })
        .attr("cy", function(d, i) { return positions[i][1]; })
        .attr("r", function(d, i) { return Math.sqrt(countByAirport[d.iata]); })
        .sort(function(a, b) { return countByAirport[b.iata] - countByAirport[a.iata]; });
  });
});

    </script>
